import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Creat from './Creat';
import Note from './Note';
import './keep.css';


const Keep = () =>{
    const hola = ()=>{
        alert('ho chuka hay');
    }
    return(
        <>
        <div className='keepMain'>
            <Header />
            <Creat tmacin={hola}/>
            <Note/>
            <Footer />
        </div> 
        </>
    );
};
export default Keep;
